import React from 'react';

const DeleteComment = (props) => {
	return (
		<button
			type="submit"
			key="delete button"
			id="delete_button"
			value={props.comment_id}
			onClick={props.removeComment}
		>
			Delete comment.
		</button>
	);
};

export default DeleteComment;
